// Projects.jsx
export function Projects() {
  return (
    <section className="p-8 max-w-4xl mx-auto" data-aos="fade-up">
      <h2 className="text-4xl font-bold mb-4 border-b-4 border-indigo-500 inline-block">Projects</h2>
      <div className="bg-white rounded-lg shadow p-6 mt-6 hover:shadow-xl transition">
        <h3 className="text-xl font-semibold">ISOPC</h3>
        <p className="mt-2">
          A web app for centralized procurement of chemicals. Built using HTML,
          CSS, JavaScript (frontend), PHP and MySQL (backend).
        </p>
      </div>
    </section>
  );
}
